import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';
import download from '../../img/download.png';

const OwnerItem = ({
  profile: { _id, name, email, cellPhone, address, model }
}) => {
  return (
    <div className='profile bg-light'>
      <img src={download} alt='' className='round-img' />
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
        <p className='my-1'> {cellPhone && <span>{cellPhone}</span>} </p>
        <Link to={`/profile/${_id}`} className='btn-btn-primary'>
          View Profile
        </Link>
      </div>
      <ul>
        <li className='text-primary'>
          <i className='fas fa-arrow'></i>{' '}
          {address && <span>{'Office base'}</span>}{' '}
        </li>
        <li className='text-primary'>
          <i className='fas fa-check'></i> {address && <span>{address}</span>}{' '}
        </li>
      </ul>
    </div>
  );
};

OwnerItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default OwnerItem;
